import React from 'react'
import { Text, View } from 'react-native';
import { WalletContext } from '../utils/context';

export default function Main() {
    const ContextValue = React.useContext(WalletContext);
    const { wallet } = ContextValue;
    console.log(wallet);
    return (
        <View>
            <Text>Test</Text>
        </View>
    )
}
